        /// <summary>
        /// 轉換型別
        /// </summary>
        /// <returns></returns>
        public EntityAML_HQ_Work_edit toEditMode()
        {
            EntityAML_HQ_Work_edit returnObj = new EntityAML_HQ_Work_edit();
            DataTableConvertor.Clone2Other<EntityAML_HQ_Work, EntityAML_HQ_Work_edit>(this, ref returnObj);
            //有子項目，一併轉換
            foreach (EntityAML_HQ_Manager_Work mangObj in _ManagerColl)
            {
                returnObj.ManagerColl.Add(mangObj.toEditMode());
            }
            return returnObj;
        }
